This dataset for the UK, Jersey and Guernsey contains the Corine Land Cover (CLC) revised for 2006. This shapefile has been created from combining the 2006 land cover layers from the individual CLC database files for the UK, Jersey and Guernsey.
CLC is a dataset produced within the frame of the Initial Operations of the Copernicus programme (the European Earth monitoring programme previously known as GMES) on land monitoring. CLC provides consistent information on land cover and land cover changes across Europe. This inventory was initiated in 1985 (initial year 1990) and then established a time series of land cover information with updates in 2000 and 2006 the last one being the 2012 reference year. CLC products are based on the analysis of satellite images by national teams of participating countries - the EEA member and cooperating countries – following a standard methodology and nomenclature with the following base parameters:
• 44 classes in the hierarchical three level Corine nomenclature;
• Minimum mapping unit (MMU) for status layers is 25 hectares;
• Minimum width of linear elements is 100 metres;
The resulting national land cover inventories are further integrated into a seamless land cover map of Europe. Land cover and land use (LCLU) information is important not only for land change research, but also more broadly for the monitoring of environmental change, policy support, the creation of environmental indicators and reporting. CLC datasets provide important datasets supporting the implementation of key priority areas of the Environment Action Programmes of the European Union as protecting ecosystems, halting the loss of biological diversity, tracking the impacts of climate change, assessing developments in agriculture and implementing the EU Water Framework Directive, among others.

Policy CS24 Biodiversity and Geological Conservation
The Borough's biodiversity and geological resource will be protected and enhanced. Priority will be given to:
a) Protection of the integrity of the European sites in and near the Borough.
b) Conserving and enhancing protected biodiversity and geodiversity sites and features in line with PPS9;
c) Improving the integrity and biodiversity value of wildlife corridors particularly along the coast, around the Teesmouth estuary and linking with the North York Moors;
d) Meeting the objectives and targets in the UK and Tees Valley Biodiversity Action Plan;
e) Encouraging management of landscape belts for nature conservation;
f) Protecting ancient woodland and veteran trees;
g) Strengthening populations of protected and target species; and
h) Improving site management and increasing public access to wildlife sites. Development will be encouraged to include measures to contribute positively to the overall biodiversity in the Borough.
